import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        position: 'relative',
        width: '100%',
        backgroundColor: '#fff',
        top: 0
    },
    header: {
        flexDirection: 'row',
        marginTop: 40,
        paddingHorizontal: 16,
        justifyContent: 'space-between',
        alignItems: 'center',
    },
    ctnSearch: {
        flexDirection: 'row',
        alignItems: 'center',
        width: '85%',
        paddingHorizontal: 20,
        paddingVertical: 6,
        backgroundColor: '#f2f4f5',
        borderRadius: 12
    },
    input: {
        fontFamily: 'Inconsolata-Medium',
        borderColor: 'transparent',
        borderWidth: 0,
        paddingVertical: 8,
        paddingHorizontal: 8,
        fontSize: 18,
        marginLeft: 4,
        width: '100%'
    },
    textIn: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 20,
    }
});

export default styles;
